// 应用的根组件

import React,{Component} from "react";
import {BrowserRouter,Route} from "react-router-dom";
import Admin from "./pages/admin/admin"



export default class App extends Component{

    render(){
        return <BrowserRouter>
        <Route path='/admin'
        Component={Admin}></Route>
        </BrowserRouter>
      
    }

}
